import React, { useState } from 'react';

export default function UseReducer() {
  const [number, setNumber] = useState(0);

  return (
    <>
      <h1>useReducer</h1>
      <p>잔고: ?원</p>
      <input
        type='number'
        value={number}
        onChange={e => setNumber(parseInt(e.target.value))}
        step='1000'
      />
      <button>예금</button>
      <button>출금</button>
    </>
  );
}
